import { colourTemplate } from './colours';
import { fontsTemplate } from './fonts';

export const colours: colourTemplate = {
    background1: "#F4EEE9",
    background2: "#FFFFFF",
    font1: "#A4381D",
    font2: "#DDDDDD",
    font3: "#DDDDDD",
};

export const logoUrl: string = "../assets/Logo.png"

export const fonts: fontsTemplateTemplate = {
    background1: "#F4EEE9",
    background2: "#FFFFFF",
    font1: "#A4381D",
};
